import React from "react";

function App() {
  // Mock data for the top-left user bar
  const user = {
    username: "JohnDoe",
    points: 1250
  };

  // Mock data for the table
  const tableData = [
    { rank: 1, name: "Alice", points: 3000, organization: "Org A" },
    { rank: 2, name: "Bob", points: 2700, organization: "Org B" },
    { rank: 3, name: "Charlie", points: 2500, organization: "Org C" }
  ];

  return (
    <div style={styles.pageContainer}>

      {/* Top-left user bar */}
      <div style={styles.userBar}>
        <span style={styles.userText}>User: {user.username}</span>
        <span style={styles.userText}>Points: {user.points}</span>
      </div>

      {/* Main table */}
      <div style={styles.tableContainer}>
        <table style={styles.table}>
          <thead>
            <tr>
              <th style={styles.th}>Rank</th>
              <th style={styles.th}>Name</th>
              <th style={styles.th}>Points</th>
              <th style={styles.th}>Organization</th>
            </tr>
          </thead>

          <tbody>
            {tableData.map((row, index) => (
              <tr key={index} style={styles.tr}>
                <td style={styles.td}>{row.rank}</td>
                <td style={styles.td}>{row.name}</td>
                <td style={styles.td}>{row.points}</td>
                <td style={styles.td}>{row.organization}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

    </div>
  );
}

/* ---------------------- STYLES ---------------------- */
const styles = {
  pageContainer: {
    display: "flex",
    flexDirection: "column",
    height: "100vh",
    padding: "20px",
    fontFamily: "Arial"
  },

  // Top-left bar 
  userBar: {
    position: "absolute",
    top: "20px",
    left: "20px",
    background: "#222",
    color: "white",
    padding: "12px 18px",
    borderRadius: "8px",
    display: "flex",
    flexDirection: "column",
    gap: "4px",
    width: "160px"
  },

  userText: {
    fontSize: "14px"
  },

  // Table container aligned center-left
  tableContainer: {
    marginTop: "100px",
    marginLeft: "20px",
    width: "50%"
  },

  table: {
    width: "100%",
    borderCollapse: "collapse",
    fontSize: "16px"
  },

  th: {
    background: "#333",
    color: "white",
    padding: "10px",
    textAlign: "left"
  },

  tr: {
    background: "#f5f5f5",
    borderBottom: "1px solid #ddd"
  },

  td: {
    padding: "10px"
  }
};

export default App;
